sys_variable_value.value:
(function execute(inputs, outputs) {

    var requestBody = {};
    if (inputs.summary)
        requestBody.summary = inputs.summary.trim().toString();
    if (inputs.description)
        requestBody.description = inputs.description.trim().toString();
    var util = new GoogleHangoutsMeetUtil();
    var defaultTZ = gs.getSession().getTimeZoneName();
    var timeZone = inputs.timeZone == "NULL_OVERRIDE" ? defaultTZ : (inputs.timeZone.toString() || defaultTZ);
    var startTime = inputs.start.toString();
    var endTime = inputs.end.toString();
    startTime = startTime.replace(" ", "T"); // + "Z"; add if no timezone entered
    endTime = endTime.replace(" ", "T"); // + "Z";
    requestBody.start = {
        "dateTime": startTime,
        "timeZone": timeZone
    };
    requestBody.end = {
        "dateTime": endTime,
        "timeZone": timeZone
    };
    var attendeesList = inputs.attendees;
    var attendeesObj = [];
    attendeesList.forEach(function(item) {
        item = item.trim();
        if (item.length == 0) {
            return;
        }
        if (item.length > 4 && util.isValidEmailAddress(item)) {
            attendeesObj.push({
                "email": item
            });
        } else {
            throw "Invalid email address has been passed as input: " + item;
        }
    });
    requestBody.attendees = attendeesObj;
    if (inputs.location)
        requestBody.location = inputs.location.trim().toString();

    outputs.calendar_id = inputs.calendarID.trim().toString() || "primary";
    outputs.conferencedataversion = 0;

    requestBody.conferenceData = {
        "createRequest": {
            "conferenceSolutionKey": {
                "type": "hangoutsMeet"
            }
        }
    };
    if (!isInputAndOutputValid()) {
        throw "Error while creating Event, invalid input has been passed";
    }
    outputs.request_body = JSON.stringify(requestBody);

    function isInputAndOutputValid() {
        return outputs.calendar_id && requestBody.summary && requestBody.start.dateTime && requestBody.end.dateTime && timeZone && requestBody.location
    }

})(inputs, outputs);

