sys_variable_value.value:
(function execute(inputs, outputs) {
	var response = JSON.parse(inputs.responseBody);
	if (inputs.statuscode != 200) {
		outputs.status = "Error";
		outputs.error_message = new HangoutsMeetErrorHandler().getErrorMessage(response);
		return;
	}
   var startDate = response.start.dateTime;
       startDate = startDate.substring(0,19);
       response.start.dateTime = startDate.replace("T"," ").toString();
   var endDate = response.end.dateTime;
       endDate = endDate.substring(0,19);
       response.end.dateTime = endDate.replace("T"," ").toString();
	outputs.status = "Success";
	outputs.event = response;

})(inputs, outputs);

